SET NOCOUNT ON;
INSERT INTO [Doctors] ([Id], [Accept], [AddressDescrption], [CollegeName], [DateOfJoin], [DateOfSendRequest], [GraduationYear], [SummaryCareer], [areaId], [doctorId], [drSpecialtieId])
VALUES (@p0, @p1, @p2, @p3, @p4, @p5, @p6, @p7, @p8, @p9, @p10);
MERGE [DoctorCertificate] USING (
VALUES (@p11, @p12, 0),
(@p13, @p14, 1)) AS i ([DoctorId], [src], _Position) ON 1=0
WHEN NOT MATCHED THEN
INSERT ([DoctorId], [src])
VALUES (i.[DoctorId], i.[src])
OUTPUT INSERTED.[Id], i._Position;

DROP INDEX [IX_pharmacyDrugs_DrugId] ON [pharmacyDrugs];
DECLARE @var1 sysname;
SELECT @var1 = [d].[name]
FROM [sys].[default_constraints] [d]
INNER JOIN [sys].[columns] [c] ON [d].[parent_column_id] = [c].[column_id] AND [d].[parent_object_id] = [c].[object_id]
WHERE ([d].[parent_object_id] = OBJECT_ID(N'[pharmacyDrugs]') AND [c].[name] = N'DrugId');
IF @var1 IS NOT NULL EXEC(N'ALTER TABLE [pharmacyDrugs] DROP CONSTRAINT [' + @var1 + '];');
ALTER TABLE [pharmacyDrugs] ALTER COLUMN [DrugId] nvarchar(450) NOT NULL;
CREATE INDEX [IX_pharmacyDrugs_DrugId] ON [pharmacyDrugs] ([DrugId]);

